function buildSkills(skills) {
  skills.map((value, index) => {
    return (
      <div key={index} className="column has-text-centered">
        <a
          href={value.url}
          target="blank"
          className="is-hovered"
          title={value.network}
        >
          <span className="icon is-medium is-">
            <i className={value.x_icon}></i>
